  false,\n\t\"url\": null,\n\t\"notes\": \"The construction of the hazard map is based
  on information from existing bedrock geologic mapping, existing surficial material
  mapping, and the analysis of topographic relief modeling to determine the percentage
  of slope. The percentage of slope was generated in geographic information systems
  (GIS) format from the 1:100,000 scale topographic map digital contour line data
  that has a contour interval of 20 meters (~65 feet). Due to the coarseness of the
  contour interval and map scale, the percentage slope could not be effectively differentiated
  into more than three categories: 0-2%, 2-20%, and greater than 20%. Because of the
  coarseness of the data the percentage of slope is extremely generalized. Liquefaction
  and amplification potential was mapped where geologic and/or surficial materials
  maps indicated alluvial materials or where the slope percentage was 0-2% in valleys.
  Landslide potential was determined by geologic/surficial materials maps that indicated
  shale in the near sub-surface with slopes greater than 20%. Where geologic data
  was not available the potential was based on greater than 20% slopes. Some select
  areas with slopes less than 20% in north-western and south-central St. Louis County
  and north-western Jefferson County were interpreted with landslide potential because
  of their known non-seismic landslide problems that would be increasingly hazardous
  during a seismic event. Collapse potential was generally applied to areas of karst
  terrain or shallow mining operations.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
